sys_variable_value.value:
(function execute(inputs, outputs) {

  var list = [];
  var qGr = new GlideRecord('x_snc_meetup_com_query');
  qGr.orderBy('name');
  qGr.addQuery('active', true);
  qGr.query();

  while (qGr.next()) {
    var obj = {
      "name"  : qGr.getUniqueValue(),
      "label" : qGr.getValue('name')
    };

    list.push(obj);
  }

  var myOutput = {
    "data" : list
  };
  outputs.output = myOutput;

})(inputs, outputs);

